Nature Documentary hosted by Aden Gillett, published by National Geographic in 2014 - English narration


Information
------------------------------

Wild Kalahari
Wild Kalahari explores the fragility of new life, as well as the strong family ties that help animals survive in one of Africa's most surreal and difficult landscapes, the Makgadikgadi Pans. It's a tale of loyalty and sacrifice, of home and exile, of death and new life, in southern Africa's largest zebra population.

